import React from "react";

import Header from "./components/Header/Header";
import Routes from "./Router";

import { Provider } from "react-redux";
import store from "../store";

import "./App.css";

const App = () => {
  return (
    <div className="contentBody">
      <Header />
      <Provider store={store}>
        <Routes />
      </Provider>
    </div>
  );
};

export default App;
